import React from "react";
import { NavLink,Outlet } from "react-router-dom";

const Menu = () => {
   
  return (
   
      <div className="second">
      
         <NavLink className="active" to="about"> About</NavLink>
         <NavLink className="active" to="search"> Search</NavLink>
         <Outlet/>
          
        
        
      </div> 
    
  );
};

export default Menu;
